import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using its placeholder (alternative selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Type 'iPhone' into the search input
    await page.fill('input[placeholder="Search Amazon"]', 'iPhone');

    // Take screenshot after entering search term
    const step2 = path.join(screenshotsDir, 'step_2_filled_search.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the search button using XPath for button with class 'search-btn' (first visible)
    const searchBtn = await page.waitForSelector('(//button[contains(@class,"search-btn")])[1]', { timeout: 5000 });
    await searchBtn.click();

    // Wait for results: look for a heading or text indicating search results
    // The UI updates mainContent with a heading containing the search term
    await page.waitForSelector('h2:has-text("iPhone")', { timeout: 5000 });

    // Take screenshot of the results
    const step3 = path.join(screenshotsDir, 'step_3_search_results.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract product titles containing 'iPhone' from visible product cards
    const productTitles = await page.$$eval(
      '.product-title',
      (nodes) => nodes.map(n => n.textContent).filter(t => t && t.toLowerCase().includes('iphone'))
    );

    return {
      success: true,
      action: "Searched for 'iPhone' products and captured results",
      extractedData: {
        foundTitles: productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
